import React from 'react';
import Massages from './Massages';
import { Container, Form, Button } from 'react-bootstrap';

const Input = ({}) => (
    <Form>
        {/* <Form.Group>
            <Form.Control 
            />
            <Massages/>
        </Form.Group> */}
        <Form.Group>
            <Massages/>
            <Form.Control 
                type='text' 
                placeholder='Type a message...'
            />
            <Button variant="primary" type="submit">
                Submit
            </Button>
        </Form.Group>
    </Form>


)

export default Input;
